// Parse AI analysis results
const allData = $input.item.json;

let analysis = {
  urgency: 'medium',
  category: 'general',
  sentiment: 'neutral',
  keywords: [],
  summary: ''
};

if (allData.output && Array.isArray(allData.output) && allData.output.length > 0) {
  const outputItem = allData.output[0];
  if (outputItem.content && Array.isArray(outputItem.content) && outputItem.content.length > 0) {
    const aiResponse = outputItem.content[0].text || '{}';
    try {
      analysis = JSON.parse(aiResponse);
    } catch (e) {
      console.log('Failed to parse AI response:', aiResponse);
    }
  }
}

// Get original form data
const workflowConfig = $('Map Form Column Names').first().json;
const emailColumnName = workflowConfig.emailColumnName || 'Email Address';
const inquiryColumnName = workflowConfig.inquiryColumnName || 'Inquiry';
const nameColumnName = workflowConfig.nameColumnName || 'Name';

return {
  email: workflowConfig[emailColumnName] || '',
  inquiry: workflowConfig[inquiryColumnName] || '',
  name: workflowConfig[nameColumnName] || '',
  urgency: analysis.urgency,
  category: analysis.category,
  sentiment: analysis.sentiment,
  keywords: analysis.keywords,
  summary: analysis.summary,
  timestamp: new Date().toISOString()
};

