// Get AI-generated email and triage data
const allData = $input.item.json;

let aiResponse = '';
if (allData.output && Array.isArray(allData.output) && allData.output.length > 0) {
  const outputItem = allData.output[0];
  if (outputItem.content && Array.isArray(outputItem.content) && outputItem.content.length > 0) {
    aiResponse = outputItem.content[0].text || '';
  }
}

// Parse subject and body from AI response
let subject = 'Thank you for your inquiry';
let body = '';

if (aiResponse) {
  const subjectMatch = aiResponse.match(/SUBJECT:\s*([\s\S]*?)(?=\nBODY:|$)/);
  if (subjectMatch && subjectMatch[1]) {
    subject = subjectMatch[1].trim();
  }

  const parts = aiResponse.split(/BODY:\s*/);
  if (parts.length > 1) {
    body = parts[1].trim();
  } else {
    body = aiResponse.trim();
  }
}

const triageData = $('Parse AI Analysis Results').first().json;

return {
  subject,
  body,
  email: triageData.email,
  name: triageData.name,
  urgency: triageData.urgency,
  category: triageData.category,
  sentiment: triageData.sentiment,
  keywords: triageData.keywords,
  summary: triageData.summary,
  inquiry: triageData.inquiry,
  timestamp: triageData.timestamp
};

